import React from 'react';
import { robots } from './robots';

const card = (props) => {
    console.log(props);
    return (
        <div className='tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
            <img alt="robot" src={`https://robohash.org/${prop.id}?set=set4&size=100x100`}/>
            <div>
                <h2>{props.name}</h2>
                <p>{props.email}</p>
            </div>
        </div>
    )
}







export default card;
